import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "../Layout.css";

// API key f칬r v칛der
const API_KEY = "73d1ee267dfb5f9b6c25f3681eb3875f";

// Lista 칬ver sj칬ar med koordinater och adress, men utan textregler
const lakes = [
  {
    key: "Lugnet",
    name: "Lugnet",
    lat: 59.11778189893817,
    lon: 15.232421965429385,
    address: "Kommer snart, Kumla kommun"
  },
  {
    key: "S칛bylundssj칬n",
    name: "S칛bylundssj칬n",
    lat: 59.16460436303601,
    lon: 15.15388129762814,
    address: "Kommer snart, Kumla kommun"
  },
  {
    key: "Nolsj칬n",
    name: "Nolsj칬n",
    lat: 59.14149881510971,
    lon: 14.56810353864065,
    address: "Kommer snart, Kumla kommun"
  }
];

function Rules() {
  const location = useLocation();
  const [selectedLake, setSelectedLake] = useState(null);
  const [lakeText, setLakeText] = useState(null);
  const [weather, setWeather] = useState(null);
  const [loadingWeather, setLoadingWeather] = useState(false);

  // Hantera f칬nsterparameter f칬r sj칬
  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const lakeKey = params.get("lake");
    const lake = lakes.find(l => l.key === lakeKey);
    if (lake) {
      setSelectedLake(lake);
      fetchWeather(lake.lat, lake.lon);
      fetchLakeText(lake.key);
    }
  }, [location]);

  // H칛mta v칛der
  const fetchWeather = async (lat, lon) => {
    setLoadingWeather(true);
    try {
      const res = await fetch(
        `https://api.openweathermap.org/data/2.5/weather?lat=${lat}&lon=${lon}&units=metric&lang=sv&appid=${API_KEY}`
      );
      const data = await res.json();

      let rainChance = 0;
      if (data.pop) {
        rainChance = Math.round(data.pop * 100);
      } else if (data.rain) {
        const rainVolume = data.rain["1h"] || data.rain["3h"] || 0;
        rainChance = rainVolume > 0 ? Math.min(100, Math.round(rainVolume * 20)) : 0;
      }

      setWeather({ ...data, rainChance });
    } catch (err) {
      console.error("Fel vid h칛mtning av v칛der:", err);
    } finally {
      setLoadingWeather(false);
    }
  };

  // H칛mta text fr친n JSON baserat p친 sj칬ns key
  const fetchLakeText = async (lakeKey) => {
    try {
      const res = await import(`../data/${lakeKey}Text.json`);
      setLakeText(res.default);
    } catch (err) {
      console.error("Kunde inte h칛mta text f칬r sj칬n:", lakeKey, err);
      setLakeText(null);
    }
  };

  const renderLakeText = () => {
    if (!lakeText) return null;
    return (
      <div className="home-text">
        {lakeText.paragraphs.map((p, i) => (
          <p key={i}><strong>{p}</strong></p>
        ))}
      </div>
    );
  };

  return (
    <div className="rules-container">
      <div className="outer-card">
        <h1>{selectedLake ? selectedLake.name : "V칛lj sj칬"}</h1>

        <div
          className="inner-card"
          style={{
            display: "flex",
            flexWrap: "wrap",
            gap: "20px",
            alignItems: "stretch"
          }}
        >
          {!selectedLake && (
            <div style={{ display: "flex", gap: "10px", flexWrap: "wrap", marginBottom: "20px" }}>
              {lakes.map(lake => (
                <button
                  key={lake.key}
                  onClick={() => {
                    setSelectedLake(lake);
                    fetchWeather(lake.lat, lake.lon);
                    fetchLakeText(lake.key);
                  }}
                  style={{
                    padding: "10px 15px",
                    cursor: "pointer",
                    borderRadius: "6px",
                    border: "1px solid #0077cc",
                    backgroundColor: "#fff",
                    color: "#0077cc",
                    fontWeight: "600",
                    transition: "all 0.3s"
                  }}
                  onMouseEnter={e => {
                    e.currentTarget.style.backgroundColor = "#0077cc";
                    e.currentTarget.style.color = "#fff";
                  }}
                  onMouseLeave={e => {
                    e.currentTarget.style.backgroundColor = "#fff";
                    e.currentTarget.style.color = "#0077cc";
                  }}
                >
                  {lake.name}
                </button>
              ))}
            </div>
          )}

          {selectedLake && (
            <>
              {/* Textinneh친ll */}
              <div style={{ flex: "1 1 340px", minWidth: 0 }}>
                <h2 style={{ fontWeight: 700, marginBottom: "16px" }}>
                  Regler f칬r {selectedLake.name}
                </h2>
                {renderLakeText()}

                <p style={{ fontWeight: 700, wordWrap: "break-word", overflowWrap: "break-word", marginTop: "12px" }}>
                  Adress: {selectedLake.address}
                </p>
              </div>

              {/* V칛der-widget */}
              {weather && !loadingWeather && weather.weather && (
                <div
                  className="weather-card"
                  style={{ flex: "1 1 280px", minWidth: 0, boxSizing: "border-box" }}
                >
                  <h2 style={{ marginBottom: "10px", color: "#51583C" }}>
                    游꺇 V칛der just nu f칬r {selectedLake.name}
                  </h2>
                  <img
                    src={`https://openweathermap.org/img/wn/${weather.weather[0].icon}@2x.png`}
                    alt="v칛derikon"
                    style={{ width: "150px", height: "150px" }}
                  />
                  <p style={{ fontSize: "20px", fontWeight: 700, margin: "6px 0" }}>
                    {weather.weather[0].description}
                  </p>
                  <p style={{ fontSize: "16px", margin: "0" }}>Temp: {Math.round(weather.main.temp)}춿C</p>
                  <p style={{ fontSize: "16px", margin: "0" }}>Vind: {Math.round(weather.wind.speed)} m/s</p>
                  <p style={{ fontSize: "16px", margin: "0" }}>Fuktighet: {weather.main.humidity}%</p>
                  <p style={{ fontSize: "16px", margin: "0" }}>游꺊 Regn: {weather.rainChance}%</p>
                </div>
              )}
            </>
          )}
        </div>
      </div>
    </div>
  );
}

export default Rules;
